  // 利用 redux hooks
  // 组件和redux关联：获取数据state和操作的XXXAction
  // 直接拿到dispatch
  const dispatch = useDispatch();

  // 发送网络请求
  // 依赖：一般不会发生dispatth改变，但保险起见，加上依赖。
  useEffect(() => {}, [dispatch]);

  return (
    <div>
      <h2>LJRecommend</h2>
      <h2> </h2>
    </div>
  );
}

